"    </a>",
"    <br/>",
"    <a class=\"medical medical_review\" href=\"mobipreview.htm?32/1/32794?source=see_link\">",
"     Principles of medication use during lactation",
"    </a>",
"    <br/>",
"    <a class=\"medical medical_review\" href=\"mobipreview.htm?16/57/17304?source=see_link\">",
"     The impact of breastfeeding on the development of allergic disease",
"    </a>",
"    <br/>",
"    <a class=\"medical medical_review\" href=\"mobipreview.htm?37/53/38745?source=see_link\">",
"     Use of psychotropic medications in breastfeeding women",
"    </a>",
"    <br/>",
"    <a class=\"medical medical_review\" href=\"mobipreview.htm?28/23/29050?source=see_link\">",
"     Prevention of HIV transmission during breastfeeding in resource-limited settings",
"    </a>",
"    <br/>",
"    <br/>",
"    The following organizations also provide reliable health information.",
