var title_f33_63_34808="Fifth metacarpal shaft fracture";
var content_f33_63_34808=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F56431%7EEM%2F63589%7EEM%2F67394%7EEM%2F74745%7EEM%2F50842&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F56431%7EEM%2F63589%7EEM%2F67394%7EEM%2F74745%7EEM%2F50842&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Mid-shaft fracture of 5th metacarpal",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 240px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An oblique mid-shaft fracture of 5th metacarpal is seen on the anteroposterior view (left panel) and also on the oblique radiograph (right panel).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Josh Bloom, MD, MPH.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Oblique metacarpal shaft fracture",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 324px; height: 342px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This oblique view shows&nbsp;a mid-shaft fracture of the 5th metacarpal with apex dorsal angulation. The&nbsp;degree of angulation is determined&nbsp;by the&nbsp;lateral view (not shown).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Josh Bloom, MD, MPH.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Measuring angulation of a metacarpal shaft fracture",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 281px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The amount of angulation of a metacarpal fracture is measured on a lateral radiograph. The angle (curved red line) between the axis of the proximal and distal fragments is measured. This mid-shaft 5th metacarpal fracture is angulated about 70 degrees and will need orthopedic referral for probable surgical reduction and fixation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kevin E Burroughs, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Oblique shaft fracture of second metacarpal",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 270px; height: 360px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This anteroposterior radiograph shows a displaced oblique fracture though the proximal shaft of the 2nd metacarpal. This fracture warrants orthopedic referral for reduction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Josh Bloom, MD, MPH.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Fourth metacarpal oblique shaft fracture",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 384px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This lateral radiograph shows a long oblique fracture of 4th metacarpal shaft. Although minimally displaced, this fracture is at high risk for subsequent proximal displacement (ie, shortening)&nbsp;of the distal fragment.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Josh Bloom, MD, MPH.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
