var title_f33_63_34811="Lesions after exposure to RADS";
var content_f33_63_34811=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F78151&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F78151&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Time course of histologic lesions of RADS at different intervals after exposure",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"4\" rowspan=\"1\">",
"        Interval After Exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        Case 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3\">",
"        60 hours",
"       </td>",
"       <td class=\"subtitle3\">",
"        15 days",
"       </td>",
"       <td class=\"subtitle3\">",
"        60 days",
"       </td>",
"       <td class=\"subtitle3\">",
"        150 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Superficial fibrinohemorrhagic layer replacing bronchial epithelium that has sloughed",
"       </td>",
"       <td>",
"        Persistence of hemorrhage, bronchial epithelium sloughing; increased deposition of collagen",
"       </td>",
"       <td>",
"        Regeneration",
"of epithelial cells (basal); collagen deposition; spots of lymphocytes;",
"few PMNs; increase in thickness of basement membrane",
"       </td>",
"       <td>",
"        Complete regeneration of the epithelium layer; numerous basal cells indicating regeneration.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        Case 2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3\" colspan=\"2\" rowspan=\"1\">",
"        45 days",
"       </td>",
"       <td class=\"subtitle3\" colspan=\"2\" rowspan=\"1\">",
"        &nbsp;98 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Severe",
"damage of the epithelial layer with few remaining basal cells;",
"subepithelial edema with inflammatory cells underneath the basement",
"membrane.",
"       </td>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Incomplete regeneration of the epithelial layer with few ciliated",
"cells; inflammatory cells persisting in epithelium and connective",
"tissue.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
