var script_f33_63_34812=[""].join("\n");
var outline_f33_63_34812=null;
var title_f33_63_34813="Etiology dystonia";
var content_f33_63_34813=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F59044&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F59044&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Etiology of dystonia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        1. Primary dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        a. Genetic forms of dystonia (DYT1)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        b. Sporadic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        2. Dystonia-plus syndromes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        a. Dopa-responsive dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        i. GCHI mutations (DYT5)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        ii. Tyrosine hydroxylase mutations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        iii. Other biopterin deficient states",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        b. Dopamine agonist responsive dystonia due to decarboxylase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        c. Myoclonus-dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        3. Other inherited (degenerative) disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        a. Autosomal dominant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        i. Rapid onset dystonia-parkinsonism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        ii. Huntington disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        iii. Machado-Joseph disease (spinocerebellar ataxia type 3)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        iv. Other spinocerebellar ataxia subtypes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        v. Dentatorubral pallidoluysian atrophy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        vi. Familial basal ganglia calcification",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        b. Autosomal recessive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        i. Wilson disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        ii. GM1 and GM2 gangliosidoses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        iii. Metachromatic leukodystrophy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        iv. Homocystinuria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        v. Hartnup disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        vi. Glutaric acidemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        vii. Methylmalonic aciduria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        viii. Pantothenate kinase-associated neurodegeneration (Hallervorden Spatz disease)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        ix. Dystonic lipidosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        x. Neuronal ceroid lipofuscinosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        xi. Ataxia telangiectasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        xii. Neuroacanthocytosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        xiii. Intraneuronal inclusion disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        xiv. Juvenile parkinsonism (parkin)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        c. X-linked recessive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        i. Lubag (X linked dystonia-parkinsonism or DYT3)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        ii. Lesch Nyhan syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        iii. X-linked deafness-dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        d. Mitochondrial",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        i. Myoclonic epilepsy with ragged red fibers (MERRF)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        ii. Mitochondrial encephalopathy with lactic acidosis and stroke-like episodes (MELAS)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        iii. Leber hereditary optic neuropathy (LHON) plus dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        4. Due to acquired/exogenous causes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        a. Perinatal cerebral injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        b. Encephalitis, infectious and post-infectious",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        c. Head trauma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        d. Pontine myelinolysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        e. Primary antiphospholipid syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        f. Stroke",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        g. Tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        h. Multiple sclerosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        i. Cervical cord injury or lesion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        j. Peripheral injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        k. Drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        i. Dopamine receptor blocking agents",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        ii. Dopamine receptor agonists",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        l. Toxins",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        m. Psychogenic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        5. Dystonia associated with parkinsonian disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        a. Parkinson disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        b. Progressive supranuclear palsy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        c. Multiple system atrophy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        d. Corticobasal degeneration",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
